import { Typography, Button, Card } from "@mui/material";
import { Box } from "@mui/system";
import file1 from "/Users/andreimaracheuski/marketplace_project/my-app/src/others/file1.png";

export const HelloBlock = () => {
  return (
    <Box
      sx={{
        display: "flex",
        alignContent: "space-between",
        // flexWrap: 'wrap',
        // ml: '2rem'
        mt: '2rem'
      }}
    >
      <Box
        sx={{
          display: "flex",
          flexDirection: "column",
        }}
      >
        <Typography variant="h5">
          {" "}
          Hello, It's my marketplace_project
        </Typography>
        <Typography
          sx={{
            mt: "1rem",
          }}
          variant="caption"
        >
          random text random" text random text random text
        </Typography>
        <Box
          sx={{
            mt: "1rem",
            display: "flex",
            alignContent: "space-between",
          }}
        >
          <Button sx={{ mr: "1.5rem" }} variant="contained">
            Upload
          </Button>
          <Button variant="contained">Explore</Button>
        </Box>
      </Box>
      <Box
        sx={{
          // display: "flex",
          position: 'relative'
          // justifyContent: 'flex-end',
          // //ml: '10rem',
          // m: 0,
          // p: 0,
        }}
      >
        <Card sx={{
          position: 'absolute',
          top: '1rem',
          left: '4rem',
        }}>
        <img src={file1} width="20%" />
        </Card>
        <Card sx={{
          position: 'absolute',
          top: '2rem',
          left: '1rem',
        }}>
        <img src={file1} width="20%" />
        </Card>
        <Card sx={{
          position: 'absolute',
        }}>
        <img src={file1} width="20%" />
        </Card>

      </Box>
    </Box>
  );
};
